import React from 'react';
import {withRouter} from 'react-router-dom';
import { Context } from '../../App';
import Contact_item from ''

export default () => {
    return(
        <Context.Consumer>
            {
                (obj) => {
                    obj.contacts.map((contact, index) => <Contact_item />)
                }
            }
        </Context.Consumer>
    );
}
